$blue: #007fff;
$yellow: #ffe300;
$black: #000000;
$white: #ffffff;
$gray: #cfcfcf;
$grayText: #979797;

%buttonYellow {
  display: block;
  position: relative;
  padding: 2px 0 0 0;
  width: 80px;
  height: 23px;
  background-color: $yellow;
  border: 1px solid $yellow;
  border-radius: 14px;
  font-family: nunito;
  color: $black;
  font-size: 12px;
  font-weight: 800;
  line-height: 16px;
  text-decoration: none;
  text-align: center;
  transition: background-color .1s ease,
    border-color .3s ease;
}

%buttonYellowHover {
  background-color: $black;
  color: $yellow;
}

html {
  scroll-behavior: smooth;
}

.wrapper *,
.wrapper *::before,
.wrapper *::after {
  box-sizing: border-box;
}

h1,
h2,
h3,
h4,
h5,
h6,
p {
  margin: 0;
}

body {
  min-height: 100vh;
  font-family: 'Myriad Pro Regular', 'Verdana', 'Arial', sans-serif;
  box-sizing: border-box;
}

.header {
  width: 100%;
  padding-top: 100px;
}

.container {
  max-width: 1100px;
  margin: 0 auto;
}

.header-menu {}

.header-mobile__btn-div {
  visibility: hidden;
  opacity: 0;
}

.header-list {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding-left: 0;
}

.header-item {
  display: block;
}

._item-avatar {
  width: 50%;
  display: flex;
  justify-content: center;
}

.header-item__link {
  width: 10%;
  height: 16px;
  color: $blue;
  font-family: 'nunito';
  font-size: 12px;
  font-weight: 800;
  line-height: 16px;
  text-transform: uppercase;
  letter-spacing: 3px;
  text-decoration: none;
}

.header-avatar {
  width: 52px;
  height: 52px
}

.img-avatar {
  user-select: none;
}

.main {}

.hello {
  padding-top: 100px;
}

.hello__title {
  font-family: nunito;
  font-size: 48px;
  font-weight: 700;
  line-height: 60px;
  text-align: center;
}

._blue {
  color: $blue;
}

.hello-list {
  display: flex;
  justify-content: center;
  padding-top: 30px;
  padding-left: 0%;
}

.hello-item {
  display: block;
  margin: 0px 18px;
}

.hello-item__link {}

.img-twitter {}

.img-behance {}

.img-instagram {}


.works {
  padding-top: 100px;
}

.works-list {
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
  align-items: baseline;
  padding-left: 0;
}

.works-item {
  display: block;
}

.works-item._item-ocean {
  align-self: flex-start;
}

.works-item._item-doors {
  margin-top: -170px;
}

.works-img {}

.works__button {
  @extend %buttonYellow;
  margin-top: -150px;
  margin-left: 50px;
}

.works__button:hover {
  @extend %buttonYellowHover;
}

.works__sub-tittle {
  width: 275px;
  height: 72px;
  color: $white;
  font-family: nunito;
  font-size: 28px;
  font-weight: 700;
  line-height: 36px;
  margin-left: 50px;
}

.img-ocean {
  width: 520px;
  height: 505px;
}

.img-ocean-mobile,
.img-mountains-mobile,
.img-doors-mobile,
.img-building-mobile {
  width: 0%;
  max-width: 0px;
  visibility: hidden;
}

.img-mountains {
  width: 520px;
  height: 737px;
}

.img-doors {
  width: 520px;
  height: 667px;
}

.img-building {
  width: 520px;
  height: 435px;
}

.works__sub-tittle._ocean {}

.works__sub-tittle._mountains {
  margin-top: -150px;
}

.works__sub-tittle._doors {
  margin-top: -150px;
}

.works__sub-tittle._building {}

.about {
  margin-top: 150px;
}

.about-list {
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
  // align-items: baseline;
  padding-left: 0;
}

.about-item {
  display: block;
  width: 47%;
  margin-top: 50px;
}

.about__sub-tittle {
  font-family: nunito;
  font-size: 28px;
  font-weight: 600;
  line-height: 30px;
}

.about__content {
  font-family: Nunito;
  font-size: 16px;
  font-weight: 600;
  line-height: 30px;
  text-align: left;
  margin-top: 30px;
}

.gad {
  margin-top: 50px;
}

.gad-list {
  display: flex;
  padding-left: 0;
}

.gad-item {
  display: block;
  width: 25%;
}

.gad-picture {}

.img-google {}

.img-airbnb {}

.img-dropbox {}

.img-google-mobile {
  width: 0%;
  max-width: 0px;
  visibility: hidden;
}

.img-airbnb-mobile {
  width: 0%;
  max-width: 0px;
  visibility: hidden;
}

.img-dropbox-mobile {
  width: 0%;
  max-width: 0px;
  visibility: hidden;
}

.links {
  margin-top: 50px;
}

.links-wrapper {
  display: flex;
  justify-content: space-between;
}

.links-list {
  display: block;
  padding-left: 0;
  width: 47%;
}

.links-item {
  display: block;
  margin-top: 40px;
}

.links-content {
  display: flex;
  justify-content: space-between;
}

._justify {
  display: block;
  padding-left: 0;
}

._gray-text {
  color: $grayText;
}

._year-mobile {
  visibility: hidden;
}

._year-desktop {
  visibility: visible;
}

.contacts {
  margin-top: 50px;
}

.row {
  display: flex;
  justify-content: space-between;
}

._width-25proc {
  width: 20%;
}

.column {}

._width-75proc {
  width: 75%;
  margin-top: 50px;
}

.contacts__sub-tittle {
  font-family: nunito;
  font-size: 28px;
  font-weight: 600;
  line-height: 30px;
}

.contacts__content {
  font-family: nunito;
  font-size: 16px;
  font-weight: 600;
  line-height: 30px;
  margin-top: 50px;
}

.contacts-list {
  display: flex;
  padding-top: 30px;
  padding-left: 0%;
}

.contacts-item {
  display: block;
  margin: 0px 18px 0px 0px;
}

._form-column {
  display: flex;
  flex-direction: column;
  width: 90%;
}

.contact-form__label {
  display: flex;
  flex-direction: column-reverse;
}

.contact-form__input {
  color: $black;
  font-family: nunito;
  font-size: 16px;
  font-weight: 600;
  line-height: 30px;
  border-top: none;
  border-right: none;
  border-left: none;
  border-bottom-color: $gray;
}

.contact-form__input::-webkit-input-placeholder {
  color: $gray;
}

._message {
  height: 100px;
  border-bottom-width: 3px;
  resize: none;
}

.contact-form__span {
  font-family: nunito;
  font-size: 12px;
  font-weight: 800;
  line-height: 16px;
  text-transform: uppercase;
  letter-spacing: 3px;
  margin-top: 20px;
  margin-bottom: 10px;
}

.contact-form__button {
  background: none;
  border: none;
  width: 52px;
  height: 52px;
}

.img-button {
  width: 52px;
  height: 52px;
}

.footer {
  margin-top: 100px;
  margin-bottom: 100px;
}

.footer__content {
  font-family: Nunito;
  font-size: 16px;
  font-weight: 600;
  line-height: 30px;
}

.footer__buttons {
  width: 30%;
  display: flex;
  justify-content: space-between;
}

.footer__button {
  color: $grayText;
  font-family: Nunito;
  font-size: 16px;
  font-weight: 600;
  line-height: 30px;
  text-decoration: none;
  // text-align: right;
}
